import React, { Component } from 'react';
import {Route, Switch} from 'react-router-dom';

import MainPage from './containers/MainPage/MainPage';

class App extends Component {
  render () {
    return (
      <div>
          <Switch>
            <Route path="/home" component={MainPage} />
          </Switch>
      </div>
    );
  }
}

export default App;
